import React, { Component } from 'react';
import Header from '../components/headerComponent/header';
import { 
  Card,
  CardImg, 
  CardText, 
  CardBody,
  CardTitle, 
  CardSubtitle, 
  NavLink,
Button,
Row,
Col 
} from 'reactstrap';
import '../pages/pages.css';
import big from '../images/large.png';

class QuizStart extends Component {
    render() {
      return (
        <div>
        <Header />

<Row>
 <Col sm="6">
      <Card body className="text-center" inverse style={{borderColor: 'white' }}> 
        <CardTitle><div className="titleText">WhyCS Quiz</div></CardTitle>
        <CardText>

        <br/>
          <div className="text">Lorem ipsum dolor sit amet, consectetur 
             adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim 
           veniam, quiepakis nostrud exercitation ullamco laboris nsi ut aliquip ex 
           ea comepmodo consetquat.
             <br/>              <br/>
      </div></CardText>
              <br/>

        <NavLink href="/startwhycsquiz">
        <Button outline color="secondary">START</Button>
        </NavLink>
      </Card>

          </Col>
    </Row>




       </div>
       );
    }
  }



export default QuizStart;
